INSERT INTO `lap_bao_gia_info` VALUES (1,'long','long','long','company_logof5557b9c-08a2-427c-90d2-d75a5ed303dc1704993091203.png','2024-04-21 10:43:44.012000','\"asdasdsaassadasdsad asdasasadassadsadsad\"','9123123123','long',1),(2,'Văn phòng:  2212 FLC Complex 36 Phạm Hùng - Phường Mỹ Đình II - Nam Từ Liêm - Hà Nội','Địa chỉ nhà xưởng: Số 168, cụm 4, Hát Môn, Phúc Thọ, Hà Nội, Việt Nam','Email: architecture.aone@gmail.com','company_logo6829a49c-d481-4309-a790-b8cda03cb9fb1724595494375.png','2024-08-25 14:18:16.545000','\"Chú thích: \\n- Báo giá đã bao gồm vận chuyển nội thành, lắp đặt, phí đo đạc thiết kế.\\n - Đơn giá trên chưa bao gồm VAT, khách hàng chỉ chịu phí VAT = 10% tổng gía trị hợp đồng khi muốn xuất hóa đơn đỏ.\\n - Bảo hành phần gỗ 3 năm, phụ kiện bảo hành 2 năm theo hãng.\\n - Báo giá cuối cùng được tính theo khối lượng thực tế tại công trình.\\n - Báo giá có giá trị trong vòng 20 ngày kể từ ngày lập báo giá.\"','Điện thoại: 0914.868.111 - 08.333.89.555','CÔNG TY TNHH KIẾN TRÚC XÂY DỰNG NỘI THẤT A ONE',27);
